import React from 'react';
import { Link } from 'react-router-dom';
import logo from './images/logoNew.png';
import logoBackground from './images/MacetLogo.png'; // Adjust the path as needed


const Navbar = () => {
  return (
    <nav
  className="navbar"
  style={{
    backgroundImage: `url(${logoBackground})`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
  }}
>
  { <div className="container-fluid">
        <div className="navbar-logo">
          <a href = "https://macet.ac.in/">
          <img src={logo} alt="Logo" className="logo" />
          </a>
          <span className="navbar-name"></span>
        </div>
        <button 
          className="navbar-toggler" 
          type="button" 
          data-bs-toggle="collapse" 
          data-bs-target="#navbarSupportedContent" 
          aria-controls="navbarSupportedContent" 
          aria-expanded="false" 
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link to="/" className="navbar-link nav-link">Home</Link>
            </li>
            <li className="nav-item">
              <Link to="/signup" className="navbar-link nav-link">Sign Up</Link>
            </li>
          </ul>

          <form className="d-flex" role="search">
            <input 
              className="form-control me-2" 
              type="search" 
              placeholder="Search" 
              aria-label="Search"
            />
            <button className="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </div>}
</nav>

